/* eslint-disable react/jsx-no-target-blank */
/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable jsx-a11y/alt-text */
import React from 'react'
import Estoque from './Images/sistema-de-estoque.png'

export default function ProjetoUm(){

    
    return(

            <div id='portfolio-2' className='container-portfolio portfolio-1'>
                <div className='div-project'>
                    <div className='block-image-project'>
                        <img className='image-project' src={Estoque}/>
                    </div>
                    <div className='block-text-project'>
                        <h3>Sistema de controle de estoque</h3>
                        <p>Criado em React.Js no front-end e em Python com Django Restframework no backend esse sistema permite controlar um estoque de almoxarifado com estimativa para esgotamente de itens. Clique em saiba mais, tenha acesso ao código e ao vídeo explicativo.</p>
                    </div>
                </div>
                <div className='button-saiba-mais'>
                    <a href='https://github.com/JeffersonLobato/sistema-de-estoque' target='_blank'><button className='saiba-mais-project'>Saiba mais</button></a>
                </div>
            </div>

    )
}
